
DROP TABLE IF EXISTS `sp500`;

CREATE TABLE `sp500` (
	`id`            int(10) NOT NULL auto_increment,
	`name`          varchar(250) NOT NULL,
	`last`          decimal(13,4) NOT NULL,
	`high`          decimal(13,4) NOT NULL,
	`low`           decimal(13,4) NOT NULL,
	`change`        decimal(13,4) NOT NULL,
	`changepct`     double NOT NULL,
	`volume`        int(9) NOT NULL,
	`day`           date NOT NULL,
	`daily`         double,
	`week`          double,
	`month`         double,
	`ytd`           double,
	`year`          double,
	`threeyear`     double,
	`hourlysignal`  varchar(250) NOT NULL,
	`dailysignal`   varchar(250) NOT NULL,
	`monthlysignal` varchar(250) NOT NULL,
	PRIMARY KEY  (`id`)
);

